import React from "react";
import "./styles/BuildControls.css";
import BuildControl from "./BuildControl";

const controls = [{ option1: "Edit" }, { option2: "Delete" }, { option3: "Add" }];

const buildControls = props => (
  <div className="BuildControls">
    {controls.map(ctrl => (
      <BuildControl key={ctrl.label} label={props.label} option1={ctrl.label} option2={ctrl.label2} option3={ctrl.label3} />
    ))}
  </div>
);

export default buildControls;
